import React, { useRef } from 'react';
import { useTranslation } from 'react-i18next';
import { motion } from 'framer-motion';
import './App.css';

export default function App() {
  const { t, i18n } = useTranslation();

  const heroRef = useRef(null);
  const coursesRef = useRef(null);
  const trainerRef = useRef(null);
  const contactRef = useRef(null);

  const changeLanguage = (e) => {
    i18n.changeLanguage(e.target.value);
  };

  const scrollToRef = (ref) => {
    ref.current?.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <div className="app dark-theme">
      <motion.nav
        className="navbar"
        initial={{ y: -60, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.6 }}
      >
        <ul>
          <li onClick={() => scrollToRef(heroRef)}>{t('navHome')}</li>
          <li onClick={() => scrollToRef(coursesRef)}>{t('navCourses')}</li>
          <li onClick={() => scrollToRef(trainerRef)}>{t('navTrainer')}</li>
          <li onClick={() => scrollToRef(contactRef)}>{t('navContact')}</li>
        </ul>
        <div className="lang-switcher">
          <select onChange={changeLanguage} defaultValue={i18n.language}>
            <option value="uz">UZ</option>
            <option value="en">EN</option>
            <option value="ru">RU</option>
          </select>
        </div>
      </motion.nav>

      <header className="hero" ref={heroRef}>
        <div className="hero-content">
          <h1>{t('heroTitle')}</h1>
          <p>{t('heroSubtitle')}</p>
          <motion.button
            className="cta"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            onClick={() => scrollToRef(contactRef)}
          >
            {t('startButton')}
          </motion.button>
        </div>
      </header>

      <section className="courses" ref={coursesRef}>
        <h2>{t('coursesTitle')}</h2>
        <div className="course-cards">
          {['course1', 'course2', 'course3'].map((course, index) => (
            <motion.div
              key={index}
              className="card"
              whileHover={{ scale: 1.05 }}
              transition={{ type: 'spring', stiffness: 300 }}
            >
              <h3>
                {index === 0
                  ? 'Strength Training'
                  : index === 1
                  ? 'Hypertrophy'
                  : 'Nutrition'}
              </h3>
              <p>{t(course)}</p>
            </motion.div>
          ))}
        </div>
      </section>

      <section className="about-trainer" ref={trainerRef}>
        <h2>{t('aboutTrainer')}</h2>
        <p>{t('trainerDescription')}</p>
      </section>

      <section className="testimonials">
        <h2>{t('testimonialsTitle')}</h2>
        <div className="testimonial-cards">
          {['feedback1', 'feedback2'].map((feedback, i) => (
            <motion.div
              className="testimonial"
              key={i}
              whileHover={{ scale: 1.03 }}
            >
              <p>“{t(feedback)}”</p>
              <span>{i === 0 ? '– Ali' : '– Dilshod'}</span>
            </motion.div>
          ))}
        </div>
      </section>

      <section className="contact" ref={contactRef}>
        <h2>{t('contactTitle')}</h2>
        <form>
          <input type="text" placeholder={t('name')} required />
          <input type="email" placeholder={t('email')} required />
          <textarea placeholder={t('message')} required></textarea>
          <motion.button
            type="submit"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            {t('send')}
          </motion.button>
        </form>
        <div className="social">
          <p>Instagram | Telegram | YouTube</p>
        </div>
      </section>

      <footer>
        <p>{t('footer1')}</p>
        <p>📍 {t('footer2')}</p>
        <p>📞 +998 90 123 45 67 | 📩 trener@example.com</p>
        <p>© 2025 MuscleMaster. {t('footer3')}</p>
      </footer>
    </div>
  );
}
